import "./NotFound.scss";

const NotFound = () => {
  return (
    <header className="container text-center">
      <div className="row">
        <div className="col">
          <h1>404 - Page Not Founded</h1>
        </div>
      </div>
    </header>
  );
};

export default NotFound;
